  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0115157 includes Surface
  underway, discrete sample and profile data collected from MAURICE EWING in the North
  Atlantic Ocean and South Atlantic Ocean from 1994-01-04 to 1994-03-21. These data
  include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3, DISSOLVED INORGANIC CARBON
  (DIC), DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, Partial pressure
  (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of
  carbon dioxide - water, Potential temperature (theta), SALINITY, SEA SURFACE TEMPERATURE,
  TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope), WATER TEMPERATURE, pH, phosphate
  and silicate. The instruments used to collect these data include CTD, Carbon dioxide
  (CO2) gas analyzer, Shower head chamber equilibrator for autonomous carbon dioxide
  (CO2) measurement and bottle.nnThese data were collected by Kenneth Johnson of Brookhaven
  National Laboratory, Aida F. Rios of Instituto de Investigaciones Marinas de Vigo
  and Douglas Wallace of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich
  Marine Biogeochemie as part of the WOCE A17 (Legs 1, 2) and WOCE_A17 data set. CDIAC
  associated the following cruise ID(s) with this data set: 3230CITHER2_1-2 and WOCE_A17nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
